import './MyOwn.css';


export const Certificates = () => {
    return (
        <div className="container">
            <div className="bubbles">

            </div>
            {/* other content */}

             <div style={{paddingLeft:200,paddingTop:200}}>
                 <div>Learning PHP</div>
                 <div>PHP Essential Training</div>
                 <div>PHP with MySQL Essential Training: 1 The Basics</div>
                 <div>PHP: Object-Oriented Programming</div>
                 <div>Node.js Essential Training</div>
                 <div>Learning Node.js</div>
                 <div>Advance your Node.js Skills</div>
                 <div>React.js Essential Training</div>
                 <div>Build Production-Ready Apps in React</div>
                 <div>Spring Boot 2.0 Essential Training</div>
                 <div>Learning Spring with Spring Boot</div>
             </div>
        </div>
    );
};
